function main(){}
function addClickToExpandImageHandlers(){var elements=document.getElementsByTagName("img")
for(var i=0;i<elements.length;i++){var element=elements[i]
if(!hasClass(element,"expand-on-click"))continue
addClass(element,"width-transition")
element._original_width_=element.width
element._contracted_=!0
element.width=element.width/2
element.addEventListener("click",clickToExpand,!1)}}
function clickToExpand(event){var element=this
if(element._contracted_){element.width=element._original_width_}
else{element.width=element._original_width_/2}
element._contracted_=!element._contracted_}
function hasClass(element,className){var classNames=element.className.split(/\s+/)
for(var i=0;i<classNames.length;i++){if(className==classNames[i])return!0}
return!1}
function addClass(element,className){if(hasClass(element,className))return
element.className+=" "+className}
function removeClass(element,className){var classNames=element.className.split(/\s+/)
for(var i=0;i<classNames.length;i++){if(className==classNames[i]){classNames[i]=""}}
element.className=classNames.join(" ")}
main()